import axios from "axios";

const queryPokemon = async (name) => {
    const resp = await axios
        .get(`https://pokeapi.co/api/v2/pokemon/${name}`)
        .then((res) => {
            console.log("res", res);
        })
        .catch((err) => console.log(err));
    console.log("resp5", resp);
    return resp;
};

export default queryPokemon;
